require_relative "../reverse_comp"
require 'rspec'

describe ReverseCompliment do
  subject(:reverse) { ReverseCompliment.new('AAAACCCGGT') }

  describe '#orig' do
    it "should equal AAAACCCGGT" do
      expect(reverse.orig).to eq "AAAACCCGGT"
    end
  end

  it "has accessor for orig" do
    is_expected.to respond_to(:orig) 
  end 
  it "has accessor for rev" do
    is_expected.to respond_to(:rev) 
  end
  it "has method reverse" do
    is_expected.to respond_to(:reverse) 
  end
  context 'case two should correctly rc seq' do
    subject(:test2) {ReverseCompliment.new('')}
    it 'should correctly reverse sequence' do
      test2.reverse
      expect(test2.rev).to eq('')
    end
  end
  context "values" do
  it "content attribute should have value \"test\"" do
    expect(reverse.reverse).to eq("ACCGGGTTTT")
  end
  it "self.rev should assign new value" do
    reverse.reverse
    expect(reverse.rev).to eq("ACCGGGTTTT")
  end

end
end
